  @override
  void initState() {
    super.initState();
    unawaited(_initProxy().then((_) => _initController()));
  }

  @override
  void dispose() {
    if (_proxy != null) {
      unawaited(_proxy!.close(force: true));
      _proxy = null;
    }
    super.dispose();
  }

  @override
  Widget build(final BuildContext context) {
    // if (_proxy == null || _webViewController == null) {
