    return TapRegion(
      onTapInside: (_) {},
      onTapOutside: (_) {
        if (widget.activeGestureInterceptor) {
          resetGestureInterceptor('flutter-3d-controller');
        }
      },
      child: WebView(
        //controller: _webViewController!,
        initialUrl: 'https://www.google.com',
        backgroundColor: Colors.transparent,
        onWebResourceError: (e) {
        },
        javascriptChannels: registerJsChannels(),
        onWebViewCreated: (controller) async {
          _initProxy().then((value) async {
            widget.onWebViewCreated?.call(controller);
            await controller.loadRequest(WebViewRequest(
                uri: Uri.parse(_proxyURL), method: WebViewRequestMethod.get));
            setState(() {
              _webViewController = controller;
            });
          });
        },
        navigationDelegate: (navigationRequest) async {
          return NavigationDecision.navigate;
        },
        javascriptMode: JavascriptMode.unrestricted,
        gestureRecognizers: const <Factory<OneSequenceGestureRecognizer>>{
          Factory<OneSequenceGestureRecognizer>(EagerGestureRecognizer.new),
        },
      ),
    );
  }

